    UserAdministrationComponent.prototype.deleteEntity = function (entityId) {
        var _this = this;
        //first check confidential state
        this.http.get(this.coreUrl + "rest/users/" + this.serialId + "/entities/" + entityId)
            .subscribe(function (data) {
            if (!data['hasConfidentialityInstances'] && !data['hasListTemplates']) {
                _this.http.delete(_this.coreUrl + "rest/users/" + _this.serialId + "/entities/" + entityId)
                    .subscribe(function (data) {
                    _this.user.entities = data.entities;
                    _this.user.allEntities = data.allEntities;
                    _this.notify.success(_this.lang.entityDeleted);
                }, function (err) {
                    _this.notify.error(err.error.errors);
                });
            }
            else {
                _this.config = { data: { hasConfidentialityInstances: data['hasConfidentialityInstances'], hasListTemplates: data['hasListTemplates'] } };
                _this.dialogRef = _this.dialog.open(UserAdministrationRedirectModalComponent, _this.config);
                _this.dialogRef.afterClosed().subscribe(function (result) {
                    _this.mode = 'delete';
                    if (result) {
                        _this.mode = result.processMode;
                        _this.http.request('DELETE', _this.coreUrl + "rest/users/" + _this.serialId + "/entities/" + entityId, { body: { "mode": _this.mode, "newUser": result.newUser } })
                            .subscribe(function (data) {
                            _this.user.entities = data.entities;
                            _this.user.allEntities = data.allEntities;
                            _this.notify.success(_this.lang.entityDeleted);
                        }, function (err) {
                            _this.notify.error(err.error.errors);
                        });
                    }
                    else {
                        $j('#jstree').jstree('select_node', entityId);
                        _this.mode = '';
                    }
                    _this.dialogRef = null;
                });
            }
        }, function (err) {
            _this.notify.error(err.error.errors);
        });
    };
